function BabyNamesList(props){

   const [addFavorite, setAddFavorite] = useState([])

    return (
      <>
        <p>Favorites:</p>
        <hr />
        <ul>
          {props.data.map((babyName) => (
            <>
              {babyName.sex === 'm' ? (
                <li className="genderFormatBoy" key={babyName.id}>
                  {babyName.name}
                </li>
              ) : (
                <li className="genderFormatGirl" key={babyName.id}>
                  {babyName.name}
                </li>
              )}
            </>
          ))}
        </ul>
      </>
    );
}


export default BabyNamesList;
